			    N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5, F@_6,
			    TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_c2s_login_account(Rest, 0, 0, F@_1, F@_2, F@_3,
				    F@_4, F@_5, F@_6, TrUserData);
      18 ->
	  d_field_c2s_login_passwd(Rest, 0, 0, F@_1, F@_2, F@_3,
				   F@_4, F@_5, F@_6, TrUserData);
      26 ->
	  d_field_c2s_login_machine_id(Rest, 0, 0, F@_1, F@_2,
				       F@_3, F@_4, F@_5, F@_6, TrUserData);
      32 ->
	  d_field_c2s_login_terminal(Rest, 0, 0, F@_1, F@_2, F@_3,
				     F@_4, F@_5, F@_6, TrUserData);
      42 ->
	  d_field_c2s_login_model(Rest, 0, 0, F@_1, F@_2, F@_3,
				  F@_4, F@_5, F@_6, TrUserData);
      50 ->
	  d_field_c2s_login_channel(Rest, 0, 0, F@_1, F@_2, F@_3,
				    F@_4, F@_5, F@_6, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_c2s_login(Rest, 0, 0, F@_1, F@_2, F@_3,
				      F@_4, F@_5, F@_6, TrUserData);
	    1 ->
		skip_64_c2s_login(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				  F@_5, F@_6, TrUserData);
	    2 ->
		skip_length_delimited_c2s_login(Rest, 0, 0, F@_1, F@_2,
						F@_3, F@_4, F@_5, F@_6,
						TrUserData);
	    3 ->
		skip_group_c2s_login(Rest, Key bsr 3, 0, F@_1, F@_2,
				     F@_3, F@_4, F@_5, F@_6, TrUserData);
	    5 ->
		skip_32_c2s_login(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				  F@_5, F@_6, TrUserData)
	  end
    end;
