read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New)
    when element(1, Prev) =:= element(1, New) ->
    merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts)
    when element(1, Prev) =:= element(1, New),
	 is_list(Opts) ->
    merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      c2s_heartbeat ->
	  merge_msg_c2s_heartbeat(Prev, New, TrUserData);
      s2c_heartbeat ->
	  merge_msg_s2c_heartbeat(Prev, New, TrUserData);
      c2s_login -> merge_msg_c2s_login(Prev, New, TrUserData);
      s2c_login -> merge_msg_s2c_login(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_c2s_heartbeat/3}).
merge_msg_c2s_heartbeat(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_s2c_heartbeat/3}).
merge_msg_s2c_heartbeat(#s2c_heartbeat{timestamp =
					   PFtimestamp},
			#s2c_heartbeat{timestamp = NFtimestamp}, _) ->
    #s2c_heartbeat{timestamp =
		       if NFtimestamp =:= undefined -> PFtimestamp;
			  true -> NFtimestamp
		       end}.

-compile({nowarn_unused_function,merge_msg_c2s_login/3}).
merge_msg_c2s_login(#c2s_login{account = PFaccount,
			       passwd = PFpasswd, machine_id = PFmachine_id,
			       terminal = PFterminal, model = PFmodel,
			       channel = PFchannel},
		    #c2s_login{account = NFaccount, passwd = NFpasswd,
			       machine_id = NFmachine_id, terminal = NFterminal,
			       model = NFmodel, channel = NFchannel},
		    _) ->
    #c2s_login{account =
		   if NFaccount =:= undefined -> PFaccount;
		      true -> NFaccount
		   end,
	       passwd =
		   if NFpasswd =:= undefined -> PFpasswd;
		      true -> NFpasswd
		   end,
	       machine_id =
		   if NFmachine_id =:= undefined -> PFmachine_id;
		      true -> NFmachine_id
		   end,
	       terminal =
		   if NFterminal =:= undefined -> PFterminal;
		      true -> NFterminal
		   end,
	       model =
		   if NFmodel =:= undefined -> PFmodel;
		      true -> NFmodel
		   end,
	       channel =
		   if NFchannel =:= undefined -> PFchannel;
		      true -> NFchannel
		   end}.

-compile({nowarn_unused_function,merge_msg_s2c_login/3}).
merge_msg_s2c_login(#s2c_login{code = PFcode,
			       user_id = PFuser_id},
		    #s2c_login{code = NFcode, user_id = NFuser_id}, _) ->
    #s2c_login{code =
		   if NFcode =:= undefined -> PFcode;
		      true -> NFcode
		   end,
	       user_id =
		   if NFuser_id =:= undefined -> PFuser_id;
		      true -> NFuser_id
		   end}.


verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      c2s_heartbeat ->
	  v_msg_c2s_heartbeat(Msg, [MsgName], TrUserData);
      s2c_heartbeat ->
	  v_msg_s2c_heartbeat(Msg, [MsgName], TrUserData);
      c2s_login ->
	  v_msg_c2s_login(Msg, [MsgName], TrUserData);
      s2c_login ->
	  v_msg_s2c_login(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_c2s_heartbeat/3}).
-dialyzer({nowarn_function,v_msg_c2s_heartbeat/3}).
v_msg_c2s_heartbeat(#c2s_heartbeat{}, _Path, _) -> ok;
v_msg_c2s_heartbeat(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, c2s_heartbeat}, X, Path).

-compile({nowarn_unused_function,v_msg_s2c_heartbeat/3}).
-dialyzer({nowarn_function,v_msg_s2c_heartbeat/3}).
v_msg_s2c_heartbeat(#s2c_heartbeat{timestamp = F1},
		    Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_int64(F1, [timestamp | Path], TrUserData)
    end,
    ok;
v_msg_s2c_heartbeat(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, s2c_heartbeat}, X, Path).

-compile({nowarn_unused_function,v_msg_c2s_login/3}).
-dialyzer({nowarn_function,v_msg_c2s_login/3}).
v_msg_c2s_login(#c2s_login{account = F1, passwd = F2,
			   machine_id = F3, terminal = F4, model = F5,
			   channel = F6},
		Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [account | Path], TrUserData)
    end,
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [passwd | Path], TrUserData)
    end,
    if F3 == undefined -> ok;
       true ->
	   v_type_string(F3, [machine_id | Path], TrUserData)
    end,
    if F4 == undefined -> ok;
       true -> v_type_int32(F4, [terminal | Path], TrUserData)
    end,
    if F5 == undefined -> ok;
       true -> v_type_string(F5, [model | Path], TrUserData)
    end,
    if F6 == undefined -> ok;
       true -> v_type_string(F6, [channel | Path], TrUserData)
    end,
    ok;
v_msg_c2s_login(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, c2s_login}, X, Path).

-compile({nowarn_unused_function,v_msg_s2c_login/3}).
-dialyzer({nowarn_function,v_msg_s2c_login/3}).
v_msg_s2c_login(#s2c_login{code = F1, user_id = F2},
		Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_int32(F1, [code | Path], TrUserData)
    end,
    if F2 == undefined -> ok;
       true -> v_type_int32(F2, [user_id | Path], TrUserData)
    end,
    ok;
v_msg_s2c_login(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, s2c_login}, X, Path).

-compile({nowarn_unused_function,v_type_int32/3}).
-dialyzer({nowarn_function,v_type_int32/3}).
v_type_int32(N, _Path, _TrUserData)
    when -2147483648 =< N, N =< 2147483647 ->
    ok;
v_type_int32(N, Path, _TrUserData) when is_integer(N) ->
    mk_type_error({value_out_of_range, int32, signed, 32},
		  N, Path);
v_type_int32(X, Path, _TrUserData) ->
    mk_type_error({bad_integer, int32, signed, 32}, X,
		  Path).

-compile({nowarn_unused_function,v_type_int64/3}).
-dialyzer({nowarn_function,v_type_int64/3}).
v_type_int64(N, _Path, _TrUserData)
    when -9223372036854775808 =< N,
	 N =< 9223372036854775807 ->
    ok;
v_type_int64(N, Path, _TrUserData) when is_integer(N) ->
    mk_type_error({value_out_of_range, int64, signed, 64},
		  N, Path);
v_type_int64(X, Path, _TrUserData) ->
    mk_type_error({bad_integer, int64, signed, 64}, X,
		  Path).

-compile({nowarn_unused_function,v_type_string/3}).
-dialyzer({nowarn_function,v_type_string/3}).
v_type_string(S, Path, _TrUserData)
    when is_list(S); is_binary(S) ->
    try unicode:characters_to_binary(S) of
      B when is_binary(B) -> ok;
      {error, _, _} ->
	  mk_type_error(bad_unicode_string, S, Path)
    catch
      error:badarg ->
	  mk_type_error(bad_unicode_string, S, Path)
    end;
v_type_string(X, Path, _TrUserData) ->
    mk_type_error(bad_unicode_string, X, Path).

-compile({nowarn_unused_function,mk_type_error/3}).
-spec mk_type_error(_, _, list()) -> no_return().
mk_type_error(Error, ValueSeen, Path) ->
    Path2 = prettify_path(Path),
    erlang:error({gpb_type_error,
		  {Error, [{value, ValueSeen}, {path, Path2}]}}).


-compile({nowarn_unused_function,prettify_path/1}).
-dialyzer({nowarn_function,prettify_path/1}).
prettify_path([]) -> top_level;
prettify_path(PathR) ->
    list_to_atom(lists:append(lists:join(".",
					 lists:map(fun atom_to_list/1,
						   lists:reverse(PathR))))).


-compile({nowarn_unused_function,id/2}).
-compile({inline,id/2}).
id(X, _TrUserData) -> X.

-compile({nowarn_unused_function,v_ok/3}).
-compile({inline,v_ok/3}).
v_ok(_Value, _Path, _TrUserData) -> ok.

-compile({nowarn_unused_function,m_overwrite/3}).
-compile({inline,m_overwrite/3}).
m_overwrite(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,cons/3}).
-compile({inline,cons/3}).
cons(Elem, Acc, _TrUserData) -> [Elem | Acc].

-compile({nowarn_unused_function,lists_reverse/2}).
-compile({inline,lists_reverse/2}).
'lists_reverse'(L, _TrUserData) -> lists:reverse(L).
-compile({nowarn_unused_function,'erlang_++'/3}).
-compile({inline,'erlang_++'/3}).
'erlang_++'(A, B, _TrUserData) -> A ++ B.


